import so from './Profile.module.css';
import MyPosts from './MyPosts/MyPosts';
import ProfileInfo from './Profileinfo/Profileinfo';

const Profile = (props) => {
    return(
        <section className={so.section}> 
        <h2>{props.h}</h2>
                <ProfileInfo />
                <MyPosts posts={props.profilePage.posts} newPostText={props.posts.newPostText} addPost={props.addPost}/>
        </section>
    )
}
export default Profile;
